script: |
  super -f text -I q12990.spq | sort > q12990.out

inputs:
  - name: q12990.spq
    data: |
      SELECT col2 + 54, 13 FROM tab0 (FORMAT parquet) WHERE NOT col2 * - 82 NOT BETWEEN - + ( - col2 ) / - col2 * col0 * - - col2 * 12 AND NULL;
  - name: tab0

outputs:
  - name: q12990.out
    data: |
